class Solution:
    def numFactors(self, n):
        i = 2
        factors = 1
        while i * i <= n:
            if n % i:
                i += 1
            else:
                n //= i
                factors *= i + 1
        if n > 1:
            factors *= n + 1
        return factors

    def numDistinctFactors(self, n):
        factors = self.numFactors(n)
        return int(factors ** 0.5)

    def numDistinctFactors7(self, n):
        factors = self.numDistinctFactors(n)
        return factors == 7
